'mail/chrome/messenger/messengercompose/composeMsgs.properties:12592' => 'Mesazhi nuk u dërgua dot, ngaqë lidhjes me shërbyesin SMTP %S i mbaroi koha. Riprovoni ose lidhuni me përgjegjësin e rrjetit tuaj.',
'mail/chrome/messenger/messengercompose/composeMsgs.properties:12593' => 'Për një arsye të panjohur, mesazhi nuk u dërgua dot duke përdorur shërbyesin SMTP %S. Ju lutemi, sigurohuni që rregullimet për shërbyesin tuaj SMTP janë të sakta dhe riprovoni, ose përndryshe lidhuni me përgjegjësin e rrjetit tuaj.',
'mail/chrome/messenger/messengercompose/composeMsgs.properties:12590' => 'Mesazhi nuk u dërgua dot, sepse dështoi lidhja me shërbyesin SMTP %S. Shërbyesi mund të jetë jashtë funksionimit ose po hedh poshtë lidhjet SMTP. Ju lutemi, sigurohuni që rregullimet për shërbyesin tuaj SMTP janë të sakta dhe riprovoni, ose përndryshe lidhuni me përgjegjësin e rrjetit tuaj.',
'mail/chrome/messenger/messengercompose/composeMsgs.properties:12591' => 'Mesazhi nuk u dërgua dot, sepse lidhja me shërbyesin SMTP %S humbi në mes të ndërveprimit. Riprovoni ose lidhuni me përgjegjësin e rrjetit tuaj.',
'mail/chrome/messenger/messengercompose/composeMsgs.properties:12596' => 'Shërbyesi SMTP %S nuk lejon fjalëkalime thjesht tekst. Ju lutemi, provoni të kaloni në &#39;Fjalëkalim i shifruar&#39; si &#39;Metodë mirëfilltësimi&#39; te &#39;Rregullime Llogarie | Rregullime shërbyesi&#39;. ',
'mail/chrome/messenger/addressbook/abMainWindow.dtd:newContactButton.tooltip' => 'Krijoni një kontakt të ri libri adresash',
'mail/chrome/messenger/messengercompose/composeMsgs.properties:12594' => 'Shërbyesi SMTP %S nuk duket se mbulon fjalëkalime të shifruar. Nëse sapo e rregulluat llogarinë, ju lutemi, provoni të ndryshoni &#39;Fjalëkalim, i transmetuar në mënyrë jo të sigurt&#39; si &#39;Metodë mirëfilltësimi&#39; te &#39;Rregullime Llogarie | Rregullime shërbyesi&#39;. Nëse deri tani punonte, dhe tani, papritmas, dështon, ky është skenar i zakonshëm se si dikush mund të grabisë fjalëkalimin tuaj.',
'mail/chrome/messenger/messengercompose/composeMsgs.properties:12595' => 'Shërbyesi SMTP %S nuk duket se mbulon fjalëkalime të shifruar. Nëse sapo e rregulluat llogarinë, ju lutemi, provoni të ndryshoni &#39;Fjalëkalim normal&#39; si &#39;Metodë mirëfilltësimi&#39; te &#39;Rregullime Llogarie | Rregullime shërbyesi&#39;. Nëse deri tani punonte, dhe tani, papritmas, dështon, ju lutemi, lidhuni me përgjegjësin ose mundësuesin e email-it.',
