'toolkit/chrome/global/aboutRights.dtd:rights.webservices-term4' => 'Shërbimet jepen &#34;siç janë.&#34;  &amp;vendorShortName;, pjesëmarrësit në të, të licencuarit prej saj, dhe shpërndarësit, nuk marrin përsipër asnjë garanci, qoftë shprehimisht apo të nënkuptuar, përfshi pa kufizime, garanci që Shërbimet janë të tregtueshme dhe të përshtatshme për qëllimet tuaja të veçanta.  Merrni mbi vete tërë rrezikun e përzgjedhjes së Shërbimeve për qëllimet tuaja dhe për cilësinë dhe funksionimin e Shërbimeve. Disa juridiksione nuk e lejojnë përjashtimin ose kufizimin e garancive të nënkuptuara, ndaj kjo klauzolë mund të mos ketë vlerë për rastin tuaj.',
